import React from "react";
import "./style.css";
import { NavLink } from "react-router-dom";

const Manu = () => {
  const isActive = {
    fontWeight: "bold",
    backgroundColor: "red",
  };
  return (
    <>
      <div class="rc_nav" id="centered_nav">
        <h1 className="title">Sayaib Sarkar</h1>
        <NavLink className="nav-link" to="/" activeStyle={isActive}>
          Home
        </NavLink>
        <NavLink className="nav-link" to="/about" activeStyle={isActive}>
          About
        </NavLink>
      </div>
    </>
  );
};

export default Manu;
